import { REQUEST_POKEMONS } from "../actions";

let initialState = {
    pokemons: [],
    types: []
}

export default function reducer(state = initialState, action) {
    switch(action.types) {
        case "REQUEST_POKEMONS":
            return {
                ...state,
                pokemons: action.payload
            }
        default: {
            return state
        }
    }
}
